import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import "../sass/style.scss";
import { Link } from "react-router-dom";
import Copyright from "../images/copyrights.svg";

const Footer = () => (
  <>
    <div id="wrap">
      <div id="main" className="App clear-top footer">
        {/* full footer row */}
        <Row className="footer-margin">
          <Col lg={3} className="d-flex footer-copyrights ">
            <img
              className="img-fluid col-centered copyrights-image"
              src={Copyright}
            />
            <p className="text-center">2020 Hira Fareed</p>
          </Col>

          <Col lg={4} className="d-flex footer-email">
            <p>hirafareedkapadia@gmail.com</p>
          </Col>

          <Col lg={5} className="d-flex footer-links">
            <p>Behance/</p>
            <p>LinkedIn/</p>
            <p>Dribble</p>
          </Col>
        </Row>
      </div>
    </div>
    <footer class="footer"></footer>
  </>
);

export default Footer;
